import React from 'react';



class Counter extends React.Component {
    state = {
      times: 0
    }
    addTimes=()=>{
        this.state
    }

    render() {
        return (
            <div>
                <h3>{ this.state.times}</h3>
                <button onClick={this.addTimes}>-1</button>
            </div>
        )
    }
}
export default Counter
